    "contracts/interfaces/IMarketplace.sol": {
      "content": "/// SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.17;

import {IPriceFeed} from "./IPriceFeed.sol";
interface IMarketplace {
    /*//////////////////////////////////////////////////////////////
                        DATA TYPES
    //////////////////////////////////////////////////////////////*/
    struct InstantOrder {
        address nftContract; // NFT contract Address.
        uint256 id; /// unique identifier of the NFT(tokenId) 
        uint256 price; /// usd price of the NFT (8 precision)
        address seller; /// address of the current owner
        bool isNative; /// by degault false.
    }

    struct AuctionOrder {
        address nftContract;
        uint256 id;
        address seller;
        uint256 validTill;
        uint256 currentPrice;
        address highestBidder;
        bool isNative;
    }

    struct AuctionBid {
        address bidder;
        uint256 amount;
        bool isNative;
    }

    /*//////////////////////////////////////////////////////////////
                        EVENTS
    //////////////////////////////////////////////////////////////*/

    /// @dev is emitted when a new instant order is created
    event InstantOrderCreated(uint256 id, uint256 price, uint256 orderId);

    /// @dev is emitted when a instant order is cancelled
    event InstantOrderCancelled(uint256 orderId);

    /// @dev is emitted when a new auction order is created
    event AuctionOrderCreated(
        uint256 id,
        uint256 price,
        uint256 deadline,
        uint256 orderId
    );

    /// @dev is emitted when an auction order is cancelled before deadline
    event AuctionOrderCancelled(uint256 orderId);

    /// @dev is emitted when a instant order is executed
    event InstantOrderExecuted(uint256 orderId, bool isNative, uint256 tokenId, address user);

    /// @dev is emitted when a new bid is place
    event BidPlaced(uint256 orderId, uint256 bidValue, bool isNative);

    /// @dev is emitted when a auction order is executed (after deadline)
    event AuctionOrderExecuted(
        uint256 orderId,
        uint256 finalBidValue,
        bool isNative
    );

    /// @dev is emitted when a price feed is updated
    event PriceFeedUpdated(
        address maticPriceFeed,
        address mctPriceFeed
    );

    /*//////////////////////////////////////////////////////////////
                        EXTERNAL FUNCTIONS
    //////////////////////////////////////////////////////////////*/

    /// @dev allows user to put out an nft on a fixed price sale
    /// @param nftContract_ is the address of the NFT contract
    /// @param id_ is the unique id of the NFT
    /// @param price_ is the usd value of the NFT
    function createInstantOrder(
        address nftContract_,
        uint256 id_,
        uint256 price_
    ) external returns (uint256 orderId);

    /// @dev allows user to create an auction for their nft
    /// @param nftContract_ is the address of the NFT contract
    /// @param id_ is the unique id of the NFT
    /// @param price_ is the starting price of the auction
    /// @param validTill_ is the deadline for the auction (in unix_timestamp)
    function createAuction(
        address nftContract_,
        uint256 id_,
        uint256 price_,
        uint256 validTill_
    ) external returns (uint256 orderId);

    /// @dev allows user to buy an open instant order
    /// @param orderId_ is the unique instant order id
    /// @param isNative_ indicates if the user pays native / mct token
    function executeInstantOrder(
        uint256 orderId_,
        bool isNative_
    ) external payable;

    /// @dev allows user to place a bid on the auction
    /// @param orderId_ is the unique auction order id
    /// @param bidValue_ is the usd value of the bid (8 decimal)
    /// @param isNative_ indicates if the user pays native / mct token
    function placeBid(
        uint256 orderId_,
        uint256 bidValue_,
        bool isNative_
    ) external payable;

    /// @dev allows seller (or) buyer to pay gas fees and settle the auction
    /// @param orderId_ is the unique auction order Id
    function executeAuctionOrder(uint256 orderId_) external;

    /// @dev allows seller to cancel his instant order
    /// @param orderId_ is the identifier of the unique order id
    function cancelInstantOrder(uint256 orderId_) external;

    /// @dev allows seller to cancel his instant order
    /// @param orderId_ is the identifier of the unique order id
    function cancelAuctionOrder(uint256 orderId_) external;

    /// @dev allows setup price fees
    /// @param maticSource_ is the external matic price oracle deployed
    /// @param mctSource_ is the external MCT price oracle
    /// @notice admin_only function call
    function updatePriceFeed(IPriceFeed maticSource_, IPriceFeed mctSource_) external;
}
